import React from "react";
import Head from "next/head";
import { Carousel } from "antd";

import AppLayout from "../components/AppLayout";
const contentStyle = {
  margin: 0,
  height: "160px",
  color: "#fff",
  lineHeight: "160px",
  textAlign: "center",
  background: "#364d79",
};
const Workout = () => (
  <AppLayout>
    <Head>
      <title>NTB</title>
    </Head>
    <div>Hello, 운동등록</div>
  </AppLayout>
);

export default Workout;
